import TextDetailPage from './components/TextDetailPage';

function App() {
  return (
    <div className="App">
    <NavigationContainer>
      <Stack.Navigator initialRouteName="CatalogPage">
        <Stack.Screen name="CatalogPage" component={CatalogPage} />
        <Stack.Screen name="SummaryDetail" component={SummaryDetailPage} />
      </Stack.Navigator>
    </NavigationContainer>
    </div>
  );
}

export default App;
